FROM `so_po_productes` `sop`
LEFT JOIN `so_po_info` `so` ON `so`.`id` = `sop`.`so_po_id`
LEFT JOIN `product` `p` ON `p`.`product_id` = `sop`.`product_id`
LEFT JOIN `unit` ON `unit`.`unit_id` = `p`.`unit_id`
LEFT JOIN `productcategory` `pc` ON `pc`.`category_id` = `p`.`category_id`
LEFT JOIN `brand` `b` ON `b`.`brandId` = `p`.`brand_id`
